text:
I went through it and I’ve seen others think the same. It’s where you think you know the best way to do something so the old software is just plain wrong and “needs to be completely rewritten” but you don’t really have enough context to understand the business cost vs reward of a rewrite.<p><pre><code>  X axis == time  
  Y axis == confidence

  |    :     :     &#x2F;
  |    : re- :   _&#x2F;
  |   &#x2F;:write:\_&#x2F;
  | _&#x2F; : it! :
  |&#x2F;___:_____:______
</code></pre>
I feel like it sits somewhere in this but I’m sure there’s a better term https:&#x2F;&#x2F;en.wikipedia.org&#x2F;wiki&#x2F;Overconfidence_effect#Overestimation<p>Edit: I screwed up the ascii chart a couple of times...
